INSERT INTO `games` VALUES ('1', 'Mobile Legend', 'mobile-legend', 'mobilelegend.jpg', 'banner-ml.jpeg', '2023-06-21 15:05:03', '2023-06-22 10:54:24', 'Mobile Legends: Bang Bang adalah permainan video seluler ber-genre multiplayer online battle arena (MOBA) yang dikembangkan dan diterbitkan oleh Moonton, anak perusahaan dari ByteDance.\r\nDirilis pada tahun 2016, game ini semakin populer di seluruh dunia, terutama di wilayah Asia Tenggara, dan sejak itu telah melampaui 1 miliar kali unduhan, dengan puncak pemain bulanan sebanyak 100 juta. Pada tahun 2021, \"Mobile Legends: Bang Bang\" mencapai pendapatan kotor sepanjang masa sebesar US$1 miliar dengan 44 persen pendapatannya berasal dari luar Asia, menjadikannya gim seluler teratas dari genre-nya dengan daya tarik paling global..');
INSERT INTO `games` VALUES ('2', 'Genshin Impact', 'genshin-impact', 'genshin.jpg', 'banner-genshin.png', '2023-06-21 15:05:03', '2023-06-22 10:59:15', 'Di benua Teyvat, orang-orang yang terpilih oleh Celestia dikaruniai sebuah kendali akan kekuatan elemen dalam bentuk Vision. Selain itu, setiap wilayah Teyvat memiliki Archon masing-masing yang merupakan entitas yang dianggap sebagai \"Dewa\" dan dipuja oleh masyarakat masing-masing wilayah. Pemain berperan sebagai seorang Pengembara atau Traveler (laki-laki bernama Aether, perempuan bernama Lumine, tergantung pilihan pemain) yang menjelajah dunia untuk mencari saudaranya yang hilang. Dalam perjalanan, Pengembara akan bertemu dengan berbagai rekan dengan watak dan kekuatan yang berbeda-beda, ia juga akan dipandu oleh makhluk kecil seperti peri bernama Paimon. Dari pengalaman bertemu dengan rekan dan menyelesaikan permasalahan di wilayah itu, Pengembara akan mengungkap kebenaran di balik dunia yang dijelajahinya sekarang.');
INSERT INTO `games` VALUES ('3', 'Honkai Star Rail', 'honkai-star-rail', 'honkai-star-rail.jpg', 'banner-hsr.jpg', '2023-06-21 15:05:03', '2023-06-22 11:00:33', 'Honkai: Star Rail (Hanzi: 崩坏: 星穹铁道; Pinyin: Bēnghuài: Xīngqióng Tiědào; harfiah: \'Honkai: Rel Kubah Bintang\') adalah permainan video bermain peran yang dikembangkan oleh miHoYo. Permainan ini diterbitkan oleh miHoYo di Tiongkok dan HoYoverse di seluruh dunia. Permainan ini dirilis pada 26 April 2023 untuk Windows dan perangkat seluler; perilisan untuk PlayStation 5 diumumkan pada Summer Game Fest 2023 dan direncanakan akan dirilis pada kuartal keempat 2023, sementara perilisan untuk PlayStation 4 dibatalkan. Honkai: Star Rail merupakan permainan keempat dalam seri Honkai yang menggunakan karakter dari Honkai Impact 3rd dan elemen alur permainan dari Genshin Impact.');
INSERT INTO `games` VALUES ('4', 'Free Fire', 'free-fire', 'free-fire.png', 'free-fire-banner.jpg', '2023-06-21 15:05:22', '2023-06-22 12:23:54', 'Garena Free Fire atau biasa disebut Free Fire (sering disingkat FF) adalah permainan battle royale yang dikembangkan oleh 111 Dots Studio dan diterbitkan oleh Garena untuk Android dan iOS. Permainan ini merupakan permainan piranti genggam yang paling banyak diunduh secara global pada tahun 2019. Karena popularitasnya, permainan ini menerima penghargaan untuk \"Best Popular Vote Game\" oleh Google Play Store pada tahun 2019. Pada Mei 2020, Garena Free Fire telah mencetak rekor dengan lebih dari 80 juta pengguna aktif harian di seluruh dunia. Pada November 2019, Garena Free Fire telah mendapat lebih dari US$1 miliar di seluruh dunia.');
INSERT INTO `games` VALUES ('5', 'Valorant', 'valorant', 'valorant.png', 'valorant-banner.jpg', '2023-06-21 16:15:42', '2023-06-22 12:24:39', 'Valorant (bergaya sebagai VALORANT) adalah permainan video POP (penembak orang pertama) taktis multipemain gratis yang dikembangkan dan diterbitkan oleh Riot Games, untuk Microsoft Windows. Pertama kali menggoda dengan nama kode Project A pada Oktober 2019, permainan memulai periode beta tertutup dengan akses terbatas pada 7 April 2020, diikuti dengan perilisan resmi pada 2 Juni 2020. Pengembangan permainan dimulai pada 2014.');
INSERT INTO `games` VALUES ('6', 'Call of Duty Mobile', 'call-of-duty-mobile', 'call-of-duty-mobile.jpg', 'call-of-duty-mobile-banner.jpg', '2023-06-21 16:30:10', '2023-06-22 12:25:23', 'Call of Duty: Mobile, biasa disingkat menjadi COD:M atau CODM adalah permainan video penembak orang pertama (POP) gratis yang dikembangkan oleh Timi Studio (anak perusahaan Tencent), dan diterbitkan oleh Activision dan Garena untuk serambi Android dan iOS. Dirilis pada 1 Oktober 2019, permainan ini melihat salah satu peluncuran permainan seluler terbesar dalam sejarah, menghasilkan lebih dari US$480 juta dengan 270 juta unduhan dalam setahun. Permainan ini diterbitkan di wilayah lain oleh Garena, Tencent Games, dan VNG Games.\r\nSejak Juni 2020, Call of Duty: Mobile telah diunduh sebanyak 2500 juta kali di seluruh dunia.');
